(1, 'media/actors/actor_1473301515.png', 'Lakshmi Picazo', 'IMDB', 'Lakshmi Picazo was Born In Mexico City, November 27. She lived In Ganeshpuri India for an extended Period of her childhood and returned to Mexico where she lived the rest of her Teen Years. In 2003 she moved to New York City to pursue her Acting career as an Actor. She studied in SUNY Purchase Acting conservatory for 4 years and Graduated in 2007. ...', 'https://www.facebook.com/lakshmi.picazo', '', 'https://twitter.com/lakshmi_picazo', 'https://www.instagram.com/lakshmipicazo/', NULL, 1, 'http://www.imdb.com/name/nm5171627'),
(2, 'media/actors/actor_2.png', 'James Russo', 'IMDB', 'A Manhattan-born character player who attended New York University, actor James Russo wrote and starred in a prize-winning short film, \"The Candy Store\", while attending college. His first big film break was as a convenience store robber in Fast Times at Ridgemont High (1982). Possessed with a stare that can bring shivers down one\'s back, he has ...', '', '', '', '', NULL, 0, 'http://www.imdb.com/name/nm0751638'),
(3, 'media/actors/actor_3.png', 'Jose Yenque', 'IMDB', 'Born in Brooklyn, New York Jose Yenque has over a decade of experience as a professional actor and devoted humanitarian, which earned him an Honorary Doctorate of Fine Arts from California State University San Marcos. Jose Yenque grew up in the theater. At the age of 14 years, Yenque\'s life was turned around by the transformative power of art when...', 'https://www.facebook.com/joseyenque/', '', 'https://twitter.com/joseyenque', 'https://www.instagram.com/jyenque/', NULL, 1, 'http://www.imdb.com/name/nm0947490'),
(4, 'media/actors/actor_1473301460.png', 'Irene Azuela', 'IMDB', 'Mexican actress, started her studies in the Centro de Formacion Actoral, she did a postgraduate course in classical Theater in the London Academy of Music and Dramatic Arts and Physical Theater at the Desmond Jones School of Mime and Physical Theater. She has appeared in several plays such as \"La Gaviota\",\"Por amor al arte\", \"Collete\" and \"Touche\"...', 'https://www.facebook.com/Irene-Azuela-1719127071691558/', '', 'https://twitter.com/ireneazuela', 'https://www.instagram.com/ireneazuela/?hl=en', NULL, 1, 'http://www.imdb.com/name/nm0044430'),
(5, 'media/actors/actor_5.png', 'Noé Hernández', 'IMDB', 'Noé Hernández is known for his work on Miss Bala (2011), Sin nombre (2009) and Un monstruo de mil cabezas (2015).', '', '', 'https://twitter.com/nohernndez7	', '', NULL, 1, 'http://www.imdb.com/name/nm2084963'),
(6, 'media/actors/actor_6.png', 'Stephanie Sigman', 'IMDB', 'Stephanie Sigman was born in 1987 in Obregon, Sonora, Mexico. She is an actress, known for Spectre (2015), Miss Bala (2011) and Pionér (2013).', 'https://www.facebook.com/StephanieSigmanpage/', '', 'https://twitter.com/SigmanStephanie?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor', 'https://www.instagram.com/stephaniesigman/?hl=en', NULL, 1, 'http://www.imdb.com/name/nm2362713'),
(7, 'media/actors/actor_1473301822.png', 'Iko Uwais', 'IMDB', 'Iko Uwais was born in Jakarta, Indonesia, to Maisyaroh and Mustapha Kamaluddin. His grandfather, H. Achmad Bunawar, was a master of silat, an Indonesian traditional martial art, and founded a silat school. Iko himself has been learning silat since he was 10 years old. He became National Champion in 2005 in Silat Demonstration category. Iko\'s talent...', 'https://www.facebook.com/Iko-Uwais-155706447787255/', '', 'https://twitter.com/iko_uwais?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor', 'https://www.instagram.com/iko.uwais/?hl=en', 1473301822, 1, 'http://www.imdb.com/name/nm3299397'),
(8, 'media/actors/actor_1473301924.png', 'Joe Taslim', 'IDMB', 'Johannes Taslim or Joe Taslim (born 23 June 1981) is an Indonesian model, actor, and former Judo athlete. He became well known in the 2012 action film The Raid: Redemption. Taslim was born in Palembang, Indonesia, to Maria Goretty and Mardjuki Taslim. He was exposed to martial arts at an early age. His martial arts training includes Wushu, Judo, ...', 'https://www.facebook.com/joetaslim.page/', '', 'https://twitter.com/Joe_Taslim?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor', 'https://www.instagram.com/joe_taslim/?hl=en', 1473301924, 1, 'http://www.imdb.com/name/nm3029144'),
(9, 'media/actors/actor_1473302005.png', 'Yayan Ruhian', 'IMDB', 'Yayan Ruhian was born in Tasikmalaya (West Java) on October 19, 1968. He found his passion in Pencak Silat and other martial arts, becoming a professional martial arts instructor. Ruhian is also known as an instructor of an inner breathing technique designed to condition of the body to withstand any impact. In 1988, he began teaching at Perguruan ...', 'https://www.facebook.com/YayanRuhian/', '', 'https://twitter.com/yayanruhian?lang=en', 'https://www.instagram.com/yayanruhian/', 1473302005, 1, 'http://www.imdb.com/name/nm3345670'),
(10, 'media/actors/actor_1473302158.png', 'Pierre Gruno', 'IMDB', 'Pierre Gruno is an actor, known for Serbuan maut (2011), The Witness (2012) and True Love (2011).', '', '', 'https://twitter.com/_pierre_gruno', '', 1473302158, 1, 'http://www.imdb.com/name/nm2679703'),
