(2, 1, 'media/films/film_1473215985.png', 'Miss Bala', '60.394667', 2016, 'test short', '\"Miss Bala\" tells the strange, seemingly impossible story of a Mexican beauty queen who becomes the accidental pawn of a drug cartel.', 'media/videos/Miss_Bala_Scene_Trailer.mp4', 'media/traillers/trailler.png', 'dx1HN3LA', 1, 1, 4, 'Mauricio Katz, Gerardo Naranjo, Ivonne Fuentes', NULL),
(7, 2, 'media/films/film_1473294969.png', 'The East', '35.477333', 2013, 'test short', 'An operative for an elite private intelligence firm finds her priorities changing dramatically after she is tasked with infiltrating an anarchist group known for executing covert attacks upon major corporations.', 'media/videos/The_East_Scene_Teaser1.mp4', 'media/traillers/trailler_1478907140.png', '2AkLF7fj', 2, 1, 4, 'Zal Batmanglij & Brit Marling', NULL),
(9, 2, 'media/films/film_1473294555.png', 'The Bronze', '60.074667', 2016, 'test short', 'A foul-mouthed former gymnastics bronze medalist with local celebrity status reluctantly trains a rising Olympics aspirant.', 'media/videos/The_Bronze_Scene_Trailer.mp4', 'media/traillers/trailler_1478893889.png', '16ciwaLQ', 4, 1, 4, 'Bryan Buckley  Melissa Rauch, Winston Rauch', NULL),
(15, 3, 'media/films/film_1473302657.png', 'The Raid: Redemption', '50.218667', 2011, 'test short', 'A S.W.A.T. team becomes trapped in a tenement run by a ruthless mobster and his army of killers and thugs.', 'media/videos/scene_teaser_1.mp4', 'media/traillers/trailler_1478825943.png', 's7IJLrmQ', 5, 1, 4, 'Gareth Evans', NULL),
(16, 0, 'media/films/film_1478903204.jpg', 'Animal Kingdom', '26.517333', 2010, '', 'A seventeen year-old navigates his survival amongst an explosive criminal family and the detective who thinks he can save him.', 'media/videos/Animal_Kingdom_Scene_Trailer.mp4', 'media/traillers/trailler_1478823729.JPG', 'AIh4ypAJ', 6, 1, 4, 'David Michôd', 1478563791),
(17, 0, 'media/films/film_1478824519.jpg', 'The Raid 2', '44.266667', 2014, '', 'Only a short time after the first raid, Rama goes undercover with the thugs of Jakarta and plans to bring down the syndicate and uncover the corruption within his police force.', 'media/videos/The_Raid_2_Scene_Trailer.mp4', 'media/traillers/trailler_1478824519.jpg', 'EUTNjMGd', 7, 1, 4, 'Gareth Evans, Richard Farrell (screenplay)', 1478824519);
