INSERT INTO `user_terms` (`content`, `last_update`) VALUES
('Welcome to the service provided by Uniform LLC. (“Second Screen”, \"we\", \"us\" and/or \"our\"). This privacy policy has been created to provide information about our company, our website and the services we provide (including through our mobile applications) (collectively, the \"Services\") to our users (\"you\" and/or \"your\"). This Privacy Policy sets forth Second Screen’s policy with respect to information, including personally identifiable data (\"Personal Data\"), that is collected from users of the Services.\r\n\r\nInformation We Collect:\r\n\r\nWhen you interact with us through the Services, we may collect Personal Data and other information from you, as further described below:\r\n\r\nPersonal Data That You Provide Through the Services:  We collect Personal Data from you when you voluntarily provide such information, such as when you register for access to our Services and/or third party services (for example, username and email address provided by services such as Facebook Connect), provide us with credit card and other payment information, use certain Services including withdrawal of funds, contact us with inquiries or respond to one of our surveys. Wherever Uniform collects Personal Data we make an effort to provide a link to this Privacy Policy.', 1472892925);
